import React from 'react';

const TiltBox = () => {
	return (
		<Tilt>
			<div className = 'brainCard b--solid'>
				<img src={require('./brain.svg')} alt='brain' className="mw2"/>
			</div>
		</Tilt>
		)
}

export default TiltBox;
